using AsyncWorkloads.Workloads.Base;
using AsyncWorkloads.Workloads.Simple;
using Microsoft.Extensions.Logging;

namespace AsyncWorkloads.Workloads.Prerequisites;

/// <summary>
/// Abstract class encapsulating the fundamental execution logic of an asynchronous workflow with one prerequisite.
/// </summary>
/// <typeparam name="TFirstPrerequisite">Expected result from running the first prerequisite workload.</typeparam>
/// <typeparam name="TResult">Expected result from running the async workload.</typeparam>
public abstract class PrerequisiteAsyncWorkload<TFirstPrerequisite, TFirstPrerequisiteResult, TResult> :
    AsyncWorkload<TResult>
    where TFirstPrerequisite : SimpleAsyncWorkload<TFirstPrerequisiteResult>
{
    public TFirstPrerequisite FirstPrerequisite { get; }

    protected PrerequisiteAsyncWorkload(
        ILogger<PrerequisiteAsyncWorkload<TFirstPrerequisite, TFirstPrerequisiteResult, TResult>> logger,
        TFirstPrerequisite firstPrerequisite) : base(logger)
    {
        FirstPrerequisite = firstPrerequisite;
    }
}

